import React, { Component } from "react";
import { Button } from "react-bootstrap";

class Hover extends Component {
  state = { ros: null, arming: null };
  render() {
    return (
      <Button variant="warning" disabled>
        Hold
      </Button>
    );
  }
}

export default Hover;
